          "title": "『ONE PIECE バウンティラッシュ』ONE PIECE DAY'23 開催記念！特別生放送",
          "description": "『ONE PIECE バウンティラッシュ』ONE PIECE DAY'23 開催記念！特別生放送を5月16日(火)20:00から配信！\n\nスペシャルゲストに、倉持由香さん、お笑い芸人のゴー☆ジャスさんをお迎えし、ONE PIECE DAY'23の情報を大公開！\nそして視聴者も参加できる特別な対戦企画も開催！\nさらに新キャラクター情報も！\n是非お見逃しなく！\n\n▼番組概要\n・番組名\n　『ONE PIECE バウンティラッシュ』ONE PIECE DAY'23 開催記念！特別生放送\n\n・日時\n　2023年5月16日(火) 20:00開始予定\n\n・出演 ※敬称略\n　倉持由香\n　ゴー☆ジャス\n　たなP（ONE PIECE バウンティラッシュ チーフプロデューサー）\n　がーそー（ONE PIECE バウンティラッシュ プロデューサー）\n\n※放送時間は目安です。\n※出演者や番組内容は予告なく変更になる場合がございます。予めご了承ください。\n\n▼アプリをダウンロード\n【App Store】\nhttps://itunes.apple.com/jp/app/id1322310031?mt=8\n\n【Google Play】\nhttps://play.google.com/store/apps/details?id=com.bandainamcoent.opbrjp\n\n▼最新情報はこちらから\n【公式サイト】\nhttps://opbr.bn-ent.net/\n\n【公式Twitter】\nhttps://twitter.com/OPBR_official\nhttps://twitter.com/OPBR_global \n\n©尾田栄一郎／集英社・フジテレビ・東映アニメーション\n©Bandai Namco Entertainment Inc."
        }
      }
    },
