      "localizations": {
        "ja": {
          "title": "King & Prince「シンデレラガール 2023」YouTube Edit",
          "description": "初回限定盤A収録 「シンデレラガール 2023」YouTube Edit。\n特設サイトはコチラ⇒https://www.deartiara.jp/vol4/\n\nKing & Prince初のベストアルバムをリリース。\n全形態DISC1にはデビューシングル「シンデレラガール 」から12thシングル「Life goes on / We are young」までの全シングル表題曲16曲と、ベストアルバムのために新たに制作した新曲「Beautiful Flower」も収録！\nそして、初回限定盤A・BのDISC2には、これまでの全リリース楽曲のシングル表題曲とアルバムリード曲以外の中から、King & Princeが2つのテーマ「SWEET & MEMORIES」「COOL & GROOVIN'」に沿ってセレクトした楽曲を各10曲収録。\n通常盤のDISC2には、これまでリリースした全アルバムのリード曲5曲を収録。\nジャケットは、髙橋海人の描き下ろしイラストとなっており、皆さまに自由に楽しんでいただけるように塗り絵仕様となったアナザージャケットも封入！\nDear Tiara盤には、1/16から「国民投票！みんなで作ろう King & Prince BEST ALBUM」と銘打ち行った楽曲投票企画によって選ばれた上位15曲を収録。\n特典映像として、初回限定盤AにはKing & Princeからのスペシャルプレゼントとして新たにメンバー5名でレコーディングを行い、撮影した「シンデレラガール 2023」のMusic VideoとDance ver.、メイキングを収録。\n初回限定盤Bには楽曲投票企画にて1位となった「King & Prince, Queen & Princess」のMusic VideoとLive Recording ver.、メイキング、Dear Tiara盤には5人だけの熱海への小旅行の様子を収めた映像を収録。\nBEST ALBUMに相応しい、King & PrinceとKing & Prince を愛してくれている皆さまで作られた超大ボリュームな作品！\n\nタイトル：『Mr.5』\n発売日：2023年4月19日(水)\n購入はコチラ⇒https://lnk.to/0419Mr5\n \n初回限定盤A\n（2CD＋DVD）￥4,950(税込)　　UPCJ-9041\n※三方背ケース付マルチケース仕様、歌詞ブックレット32P、フォトブックレット60P\n\n初回限定盤B\n（2CD＋DVD）￥4,950(税込)　　UPCJ-9042 \n※三方背ケース付マルチケース仕様、歌詞ブックレット32P、フォトブックレット60P\n \n通常盤\n（2CD）￥3,300(税込)　　UPCJ-1005/6\n※2Dワイドケース仕様、歌詞フォトブックレット32P、アナザージャケット(塗り絵ver.)\n \nDear Tiara盤 \n（2CD+DVD）￥4,950(税込)　　PROJ-1920\n※96Pフォトブック型ジャケット(A4変形判)\nジャニーズオンライン（Dear Tiara盤のみ）\nhttps://johnnys-shop.jp/s/j/item/detail/PROJ-1920\n\n≪初回限定盤A≫\n(CD―DISC1)※全形態共通\n1. シンデレラガール\n2. Memorial\n3. 君を待ってる\n4. koi-wazurai\n5. Mazy Night\n6. I promise\n7. Magic Touch\n8. Beating Hearts\n9. 恋降る月夜に君想ふ\n10. Lovin' you\n11. 踊るように人生を。\n12. TraceTrace\n13. ツキヨミ\n14. 彩り\n15. Life goes on\n16. We are young\n17. Beautiful Flower (新曲)\n\n(CD―DISC2)\n“SWEET & MEMORIES” Selected by King & Prince\n1. Love Paradox\n2. Key of Heart\n3. エスコート\n4. 僕のワルツ\n5. A Little Happiness\n6. 気楽にやろうよ\n7. Amazing Romance\n8. 幸せがよく似合うひと\n9. 愛を伝えましょう\n10. 花束\n\n(DVD)\n・「シンデレラガール 2023」 Music Video\n・「シンデレラガール 2023」 Music Video - Dance ver. -\n・「シンデレラガール 2023」 Behind the scenes\n\n≪初回限定盤B≫\n(CD―DISC1)※全形態共通\n1. シンデレラガール\n2. Memorial\n3. 君を待ってる\n4. koi-wazurai\n5. Mazy Night\n6. I promise\n7. Magic Touch\n8. Beating Hearts\n9. 恋降る月夜に君想ふ\n10. Lovin' you\n11. 踊るように人生を。\n12. TraceTrace\n13. ツキヨミ\n14. 彩り\n15. Life goes on\n16. We are young\n17. Beautiful Flower (新曲)\n\n(CD―DISC2)\n“COOL & GROOVIN'” Selected by King & Prince\n1. Easy Go\n2. ナミウテココロ\n3. Kiss & Cry\n4. Nothing compares\n5. Little Christmas\n6. Romantic\n7. Started\n8. Moon Lover\n9. Last Train\n10. Bounce\n\n(DVD)\n・「King & Prince, Queen & Princess」 Music Video\n・「King & Prince, Queen & Princess」 Music Video - Live Recording ver. -\n・「King & Prince, Queen & Princess」 Behind the scenes\n\n\n≪通常盤≫\n(CD―DISC1)※全形態共通\n1. シンデレラガール\n2. Memorial\n3. 君を待ってる\n4. koi-wazurai\n5. Mazy Night\n6. I promise\n7. Magic Touch\n8. Beating Hearts\n9. 恋降る月夜に君想ふ\n10. Lovin' you\n11. 踊るように人生を。\n12. TraceTrace\n13. ツキヨミ\n14. 彩り\n15. Life goes on\n16. We are young\n17. Beautiful Flower (新曲)\n\n(CD―DISC2)\n1. Naughty Girl\n2. &LOVE\n3. 僕らのGreat Journey\n4. Namae Oshiete\n5. ichiban\n\n\n≪Dear Tiara盤≫\n(CD―DISC1)※全形態共通\n1. シンデレラガール\n2. Memorial\n3. 君を待ってる\n4. koi-wazurai\n5. Mazy Night\n6. I promise\n7. Magic Touch\n8. Beating Hearts\n9. 恋降る月夜に君想ふ\n10. Lovin' you\n11. 踊るように人生を。\n12. TraceTrace\n13. ツキヨミ\n14. 彩り\n15. Life goes on\n16. We are young\n17. Beautiful Flower（新曲）\n\n(CD―DISC2)\n国民投票 Top 15 Tracks\n1. King & Prince, Queen & Princess\n2. Focus\n3. NANANA\n4. ゴールデンアワー\n5. Dream in\n6. Prince Princess\n7. 今君に伝えたいこと\n8. 僕の好きな人 (平野紫耀、髙橋海人、岸優太)\n9. 宙 (SORA)\n10. Dear My Tiara\n11. 君とメリークリスマス\n12. 君がいる世界\n13. Glass Flower\n14. Bounce To Night\n15. OH! サマー KING\n\n(DVD)\nKing & Princeの小旅行 in 熱海！\n＊King & Princeが熱海のアクティビティやグルメで１日を満喫する小旅行企画映像\n先着外付け特典\n・初回限定盤A／フォトカード(A6サイズ)\n・初回限定盤B／クリアポスター(A4サイズ)\n・通常盤／アナザージャケット5種セット \n※特典は先着です。数に限りがございます。ご予約ご購入の際は必ず、各店舗／各ECサイトでご確認ください。\n外付け特典\n・Dear Tiara盤／ステッカーシート(A6サイズ)\n \n初回封入特典\n・初回限定盤Ａ／期間限定動画Ａ視聴シリアルナンバー\nSpecial Music Video from King & Prince Recording Movie\n・初回限定盤B／期間限定動画B視聴シリアルナンバー\n「楽曲投票ランキング予想大会！\n・通常盤／期間限定動画C視聴シリアルナンバー\n「Mr.5」Jacket Shooting Making\n視聴期間：2023年4月18日(火) 昼12:00～5月2日(火) 18:00まで\n※３形態共に初回プレス分にのみ封入となります。\n※Dear Tiara盤にはシリアルナンバー封入はございません。\n\n#KingandPrince #Mr5 #BESTALBUM #シンデレラガール2023"
        }
      }
